import { ADD_DIARY } from '../actions/types';

const initialState = {
    diaries: [],
    loading: false
}

export default function (state = initialState, action) {
    switch (action.type) {
        case ADD_DIARY:
            console.log(action);
           return [
            action.diary.data,
            ...diaries
           ]
        default:
            return state;
    }
}
